import Card from './Card';
import logo from './logo.svg';
import faker from 'faker';

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <Card name={`${faker.name.firstName} ${faker.name.firstName}`} title={faker.name.jobTitle}/>
      <Card name='Ankush' workstatus="Working"/>
      <Card name='Afsar' workstatus="Learning React"/>
    </div>
  );
}

export default App;
